//this intro doesnt really need to be changed
import thatme from '../assets/thatme.png'

const Aboutme = (props) => {
    return (
        <div className="container-fluid my-container">
            <div className="row" style={{justifyContent: 'center',}}>
                <div className="row bound my-row" style={{width:'100%'}}>

                    {/* Title Col */}
                    <div className="col my-container d-flex align-content-center">
                        <h1>What I'm up to</h1>
                    </div>

                    {/* Content Col */}
                    <div className="col my-container">
                        <p>{props.firstChunk}{props.secondChunk}</p>
                        <div style={{height:'12px',width:'100%'}}></div>
                        <img src={thatme} style={{width:'80%'}}/>
                    </div>

                </div>
            </div>
        </div>
    )
}

export default Aboutme
